// REACT
import { useEffect } from 'react';

// COMPONENTS
import ProjectCard from "../../components/projectCard/ProjectCard";

function Home() {
    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch("https://firestore.googleapis.com/v1/projects/monportfolio-8dd08/databases/(default)/documents/works");
                const data = await response.json();
                const projetsData = data.documents.map(doc => doc.fields);
                console.log("fetchData", projetsData);
            } catch (error) {
                console.error("Error fetching data:", error);
            }
        }

        fetchData();
    }, [])

    return (
        <main>
            <section>
                <div>
                    <ProjectCard />
                </div>
            </section>
        </main>
    )
}

export default Home;
